import React, { useState, useEffect } from "react";
import axios from "axios";
import "./Products.css";
import AddProductForm from "./AddProductForm";

const Products = () => {
  const [products, setProducts] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [showAddForm, setShowAddForm] = useState(false);

  useEffect(() => {
    // Fetch all products when the component mounts
    const fetchAllProducts = async () => {
      try {
        const response = await axios.post(
          `http://localhost:8082/api/products/all?isAdmin=true`
        );
        setProducts(response.data);
      } catch (error) {
        console.error("Error fetching products:", error);
      }
    };

    fetchAllProducts();
  }, []);

  const handleSearch = async () => {
    // Implement search functionality
  };

  const handleDelete = async (id) => {
    try {
      await axios.post(`http://localhost:8082/api/products/delete/${id}/true`);
      alert(`Product '${id}' deleted`);
      // Update products state to remove the deleted product
      setProducts(products.filter((product) => product.id !== id));
    } catch (error) {
      console.error("Error deleting product:", error);
    }
  };

  const handleAddProduct = () => {
    setShowAddForm(true);
  };

  const handleSubmitProduct = (newProduct) => {
    // Implement the logic to add the new product to your list of products
    // For example:
    // setProducts([...products, newProduct]);
    console.log(newProduct);
    setShowAddForm(false); // Close the form after submission
  };

  return (
    <div>
      <h2>Products</h2>
      <div className="search-container">
        <input
          type="text"
          className="search-input"
          placeholder="Search by id"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <button className="search-button" onClick={handleSearch}>
          Search
        </button>
      </div>
      <div>
        <button className="add-button" onClick={handleAddProduct}>
          Add New Product
        </button>
      </div>
      <div>
        <button className="viewAll-button" onClick={handleViewAllProduct}>
          View All Products
        </button>
      </div>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Description</th>
            <th>Price</th>
            <th>Quantity</th>
            <th>Time - MS</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {products.map((product) => (
            <tr key={product.id}>
              <td>{product.id}</td>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.price}</td>
              <td>{product.quantity}</td>
              <td>{product.time}</td>
              <td>
                <button
                  className="delete-button"
                  onClick={() => handleDelete(product.id)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      {showAddForm && <AddProductForm onSubmit={handleSubmitProduct} />}
    </div>
  );
};

export default Products;
